                                {recipes.map(recipe => (
                                    <option value={recipe.id}>{recipe.Tittle}</option>
                                ))}
                            </select>
                        </td>
                    </tr>
                    <tr>
                    <th>VIERNES</th>
                    <td>
                            <select name="d5" value={horario.d5}>
                            <option value={""}>{"----"}</option>
                                {recipes.map(recipe => (
                                    <option value={recipe.id}>{recipe.Tittle}</option>
                                ))}
                            </select>
                        </td>
                        <td>
